import React from "react"
import "../App.css";
import BoxImage from "../images/illustration-woman-online-desktop.svg";
import WomanImage from "../images/illustration-box-desktop.svg";


class Illustration extends React.Component {
    render() {
        return (
            <div class="imageContainer">
                <img class="box-img" src={BoxImage} />
                <img class="woman-img" src={WomanImage} />

            </div>
        );
    }
}

export default Illustration;
